      var y = await "Hello World";
      console.log(y);
    };

    console.log(1);
    getData();
    console.log(2);
  };

  let myData = Abc();
  console.log("aaaaaaaaaaaaaa");
  console.log(myData);
  console.log("bbbbbbbbbbbbb");
